思路：
1、将数组看成是一个加数，需要num和key逐位相加，需要考虑到进位，先定义一个是否进位的变量，0为不进位，1为进位，索引为num.length - 1 即数组中的最后一个，和key中的最小位相加，从而得知是否进位和计算得出当前的进位后的结果，然后新数组首部添加，在将key右移，用十位相加，依次类推，百位相加，索引自减1，直到 i>=0||k>0||carry>0都不满足时，则退出循环，返回相加后的结果
时间复杂度分析：
2、因为数组有多少个，就要有多少个进行相加，例如[1,2,3,4,5,6]和45，数组中的每项都需要加，索引其时间复杂度为O(N)
/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function(num, k) {
       let carry = 0 // 是否进位 0-不进位 1-进位
  let i = num.length - 1
  let result = []
  // 逐位相加
  while (i >= 0|| k > 0 || carry > 0) {
    let digit = (i >= 0 ? num[i] : 0) + (k % 10) + carry
    carry = Math.floor(digit / 10)
    digit = digit % 10
    result.unshift(digit)
    k = Math.floor(k / 10)
    i--
  }
  return result
};

