### 思路
1. 正序反序依次遍历一次，记录距离上一个匹配的距离
2. 在每次的赋值判断场景有：

    a. 目前为止还未出现的匹配字母，不赋值

    b. 当前匹配，赋值0

    c. 已经出现匹配，原来的res位置为空，需要赋值

    d. 已经出现匹配，原来的res位置有值，大于当前距离计数，用当前的计数覆盖

    e. 已经出现匹配，原来的res位置有值，小于等于当前距离计数，不进行覆盖

### 代码
```java


/**
 * @param {string} s
 * @param {character} c
 * @return {number[]}
 */
var shortestToChar = function(s, c) {
    let res = new Array(s.length)
    let inOrderFn = ((a=-1)=>++a)
    let reverseFn = ((a=s.length)=>--a)
    let triverse = (res, s,c,getFn)=>{
        let idx = getFn()
        let counter = undefined
        while(idx<s.length && idx > -1){
            if(s[idx] === c){
                counter = 0
                res[idx] = counter
                counter++
            }
            else if(res[idx] < counter || counter === undefined ){
                // do not replace value 
            }
            else{
                res[idx] = counter
                counter++
            }
            idx = getFn(idx)
        }
        return res
    }
    res = triverse(res, s, c, inOrderFn)
    res = triverse(res, s, c, reverseFn)
    return res
};

```

