# 思路
分而治之，最近的字符距离 = min(左边最近的字符距离，右边最近的字符距离)
因此第一次从左到右遍历s，记录每个字符和其左边最近字符的距离
第二次从右往左遍历s，记录每个字符和其右边最近字符的距离，同时更新最小值

# 代码
class Solution:
    def shortestToChar(self, s: str, c: str) -> list[int]:
        n = len(s)
        res = [0]*n

        # 从左到右遍历
        c_pos_lr = -1
        for i in range(n):
            if s[i] == c:
                c_pos_lr = i
            if c_pos_lr != -1:
                res[i] = abs(i-c_pos_lr)
        # 从右往左遍历
        c_pos_rl = -1
        for i in range(n-1,-1,-1):
            if s[i] == c:
                c_pos_rl = i
            if c_pos_rl != -1:
                if s[i] != c and res[i] ==0:
                    res[i] = abs(i-c_pos_rl)
                else:
                    res[i] = min(abs(i-c_pos_rl),res[i])
        return res

# 复杂度
时间复杂度 O(N)
空间复杂度 O(N)

